import React from "react";

const SearchBar = () => {
  const BarStyling = {
    width: "30rem",
    background: "#F2F1F9",
    border: "none",
    padding: "0.5rem",
    height: "32px",
    borderRadius: "80px",
    paddingLeft: "2rem",
  };
  return (
    // <input style={BarStyling} placeholder={"Cerca..."} />
    <select style={BarStyling}>
      <option value="grapefruit">Grapefruit</option>
      <option value="lime">Lime</option>
      <option selected value="coconut">
        Coconut
      </option>
      <option value="mango">Mango</option>
    </select>
  );
};

export default SearchBar;
